import React from 'react'

function Allcrypto() {

    const [items, setItems] = useState([])



    useEffect(() => {
        fetch("https://api2.binance.com/api/v3/ticker/24hr")
            .then(res => res.json())
            .then(
                (result) => {
                    //   setIsLoaded(true);
                    setItems(result);
                    // console.log(result)
                },
                (error) => {
                    console.log(error)
                }
            )

    }, [])

    return (
        <div>
            {items.map((item) => {
                <Home>
                   {item.symbol}
                </Home>

            })}
        </div>
    )
}

export default Allcrypto
